import React from 'react'
import './Button.css'

function Button({variant,color,clickHandler,name,disabled, ...rest}) {
    let className = (disabled) ? `button ${variant} ${color} disabled`:  `button ${variant} ${color}`
    return (
        
       <button className={`button ${variant} ${color}`} onClick={(e)=>clickHandler(e)} disabled={disabled}>
           {name}
       </button>
    )
}

export default Button
